import React, { Component } from 'react';
import Header from './Header';
import Footer from './Footer';

export class Layout extends Component {
	render() {
		return (
			<div className="app">
				<Header />
				<body>{this.props.children}</body>
				<Footer />
			</div>
		);
	}
}

export default Layout;
